import SecondaryButton from './secondaryButton.js';

class Play extends Component {
  render() {
    return (
      <div className='play_holder'>
        <div className='row1_container'>
          <div className='row1_1'></div>
        </div>
      </div>
    );
  }
}

export default Play;
